import axios from 'axios'
import { LOGIN_REQUEST } from '../actions/auth/auth.types'

export const login = (email, password) => async (dispatch) => {
  console.log(action)
  dispatch({
    type: LOGIN_REQUEST,
  })
  const { data } = await axios.post('/api/admin/signin', { email, password })
}
